import styles from './styles.module.css'

export const Users = () => {
    const data = [
        {title: 'UM System Group',
    email: 'example@mail.ru',
    number: '+77007007070',
    role: 'admin',
    franchise: 'Шымкент, Сарыагаш',
    balance: '250000'}
    ]
    
    return (
        data
        ? <div className={styles.table}>
            <div className={styles.tableHeader}>
                {data.map(el => {
                    const title = el.title
                    return (
                        <div className={styles.table_title}>{title}</div> // ref to component with column idx for resize sync
                    )
                })}
            </div>
        </div>
        : <div>no data</div>
    )
}
